/* eslint-disable react/prop-types */
/* eslint-disable react/react-in-jsx-scope */
import GoogleMapReact from 'google-map-react';

const Map = ({ center, zoom }) => {
    return (
      <div className="map">
        <GoogleMapReact
          style={{ width: '100%', height: '500' }}
          defaultCenter={center}
          defaultZoom={zoom}
        />
      </div>

    );
};

Map.defaultProps = {
    center: {
        lat: '42.3025',
        lng: '-122.0739',
    },
    zoom: 6,
};

export default Map;
